import React from 'react';
import styled from "styled-components";
import {RowContainer} from "../components/header/header";
import Text from "../theme/text";
import Button from "../theme/button";

const ModRowContainer = styled(RowContainer)`
  justify-content: space-between;
  margin-top: 50px;
  align-items: end;
`;

const Notifications = () => {
    return (
        <>
            <ModRowContainer style={{marginBottom: "60px"}}>
                <Text color={"black"} fontSize={"40px"}>
                    Notifications
                </Text>
                    <Button padding={"5px 8px"} background={"#DDDDDD"} border={"black"}>
                        <Text color={"black"} fontSize={"16px"}>
                            Mark everything as read
                        </Text>
                    </Button>
            </ModRowContainer>
             <div style={{padding: "15px", border: "1px solid #000000", borderRadius: "5px"}}>
                <div style={{backgroundColor: "#DDDDDD", padding: "5px 0 5px 12px", width: "680px", borderRadius: "5px"}}>
                    <Text color={"black"} fontSize={"16px"}>
                        Your Negev | dev_texture has reached percent goal. Please, check your investment bag.
                    </Text>
                </div>
                <ModRowContainer style={{justifyContent: "end", columnGap: "15px"}}>
                    <Button padding={"2px 32px"} background={"#DDDDDD"} border={"black"}>
                        <Text color={"black"} fontSize={"16px"}>
                            Mark as read
                        </Text>
                    </Button>
                    <Button padding={"5px 11px"} background={"#DDDDDD"} border={"black"}>
                        <Text color={"black"} fontSize={"16px"}>
                            To investment bag
                        </Text>
                    </Button>
                </ModRowContainer>
            </div>
        </>
    )
}

export default Notifications;
